import './App.scss';
import { Routes, Route } from 'react-router-dom';
import Layout from './pages/layout/Layout';

function App() {
	return (
		<Routes>
			<Route path='/post' element={<Layout />}></Route>
		</Routes>
	);
}

export default App;
